import { useNavigate } from "react-router-dom";
import * as f from "react-foundation";
export const Dashboard = () => {
  let nav = useNavigate();
  return (
    <>
    <div style={{position:"relative",wi}}>

    </div>
      <f.Button style={{ marginRight: "20px" }} onClick={() => nav("/luan")}>
        luan
      </f.Button>
      <f.Button style={{ marginRight: "20px" }} onClick={() => nav("/dang")}>
        dang
      </f.Button>
      <f.Button style={{ marginRight: "20px" }} onClick={() => nav("/tuan")}>
        tuan
      </f.Button>
    </>
  );
};
